script: |
  super -f text -I q5620.spq | sort > q5620.out

inputs:
  - name: q5620.spq
    data: |
      SELECT - col1 - col1 FROM tab2 (FORMAT parquet) WHERE ( col2 ) NOT BETWEEN col0 * + col0 / col0 AND ( tab2.col2 * + col0 ) AND ( col1 * col1 ) NOT IN ( - tab2.col0 + col1 );
  - name: tab2

outputs:
  - name: q5620.out
    data: |
      -118
      -34
